import React, { useEffect, useState } from 'react'
import axios from 'axios';

function GetRoomDetails() {
  const [roomData, setRooms] = useState([]);
  useEffect(() => {
    debugger;
    axios.get('http://localhost:8080/room/getAllRooms')
      .then(response => setRooms(response.data))
      .catch(error => console.error('Error fetching room data:', error));
      console.log(roomData.id);
  }, []);
  return (
    <div className="container">
      <h1 className="my-4">Room List</h1>
      <div className="row">
        {roomData.map(room => (
          <div className="col-md-4 mb-4" key={room.id}>
            <div className="card">
              <div className="card-body">
                <img class="card-img-top" src="https://cf.bstatic.com/xdata/images/hotel/max1024x768/42565760.jpg?k=0267f660f854e0124514da32155e334b22d95d9ff8e3eb99b364a5fe00da2760&o=&hp=1"
                  alt={`Room ${room.id}`} />
                <p className="card-title">Room ID: {room.id}</p>
                <p className="card-text">
                 Status : {room.status === 0 ? 'Available' : 'Not Available'}
                </p>
                <p className="card-text">Type: {room.type}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default GetRoomDetails
